import { useEffect, useState } from 'react';
import { useCookies } from 'react-cookie';
import Router from 'next/router';
import ShowMetrics from './management/influencer/show.metrics.component';
import PanelPrivacy from './management/influencer/panel.privacy.component'

const MyProfileComp = () => {
    const [cookies, setCookie] = useCookies(['user']);
    const [valueDate, onChangeDate] = useState(new Date());
    useEffect(() => {
        if(cookies.user 
            && cookies.user.rol !== 'influencer'){
            Router.push('/')
        }else if(!cookies.user){
            Router.push('/')
        }
    })
    const options = { year: 'numeric', month: 'long', day: 'numeric' };
    return(
        <>
        <article className="col-12 col-sm-12 col-lg-12 col-xl-12 bg-dark text-light mb-2 p-4">
            <img src="img/party.png" alt="welcome" className='party-title-gestion'/><h2 className='d-inline p-4 title-gestion'>Bienvenido a tu perfil, {cookies.user ? cookies.user.user : 'anónimo'}</h2><span></span>
            <span className='text-light bg-dark p-2 time-gestion'>{valueDate.toLocaleDateString("es-AR", options)}</span>
        </article>
        <ShowMetrics/>
        <article className='col-8 col-sm-8 col-lg-8 col-xl-8 p-5'>
            <h5>Mi cuenta</h5>
        </article>
        <article className='col-4 col-sm-4 col-lg-4 col-xl-4 p-5 bg-danger btn-support-influencer'>
            <a href='#' className='btn btn-primary' target='_blank'>Contactar soporte</a>
        </article>
        <article className='col-12'>
            <hr/>
        </article>
        <PanelPrivacy dataUser={cookies}/>
        </>
    )
}
/*
    rol: String*/

export default MyProfileComp;
